import React from 'react'
import { FaBeer } from "react-icons/fa";
import imagen1 from "../assets/img/22a.jpg"
import imagen2 from "../assets/img/coaching.jpg"
export const CarouselAsos = () => {
    const images = [imagen1,imagen2]
        
        
    
  return (
    <div className='max-w-[1400px] h-[780px] m-auto py-16 px-4 relative'>
        <div className='flex w-full h-full rounded-3xl bg-center bg-cover duration-500'>
            {images.map((s)=>{
                return (
                    <img src={s} alt=""  />
                )
            })}

        </div>

    </div>
  )
};
